import React, { useEffect,useState } from 'react';
import fetch_token from './fetch_token.js'; // 导入 fetch_token 函数
import fetch_calendar from './calendar.js';

function App() {
    const username = "1wawdadadwa5219";
    const team= "울산";
    const [calendarData, setCalendarData] = useState([]); 

    const Local_username = localStorage.getItem('Localusername');
    const Local_team = localStorage.getItem('Loaclteam');
    const token = localStorage.getItem('access_token');
    const message = localStorage.getItem('msg');

    useEffect(() => {
      if(username !== Local_username &&team !== Local_team){
        fetch_token(username,team);
      }
  }, [username]);

  useEffect(() => {
    const getCalendarData = async () => {
        if (token) {
            try {
                const data = await fetch_calendar(token);
                setCalendarData(data); // 存储获取到的数据
            } catch (error) {
                console.error("Error fetching calendar data:", error);
            }
        }
    };

    getCalendarData(); // 调用获取数据的函数
}, [token]); // 当 token 变化时重新请求数据


    return (
        <div>
            <h3>Information</h3>
            <p>Token: {token || "No token available"}</p>
            <p>Message: {message || "No message available"}</p>

            <h3>Past Events</h3>
            <ul>
                {calendarData.map(event => (
                    <li key={event.id}> {/* 假设每个事件都有一个唯一的 id */}
                        {event.title} - {event.date} {/* 假设事件有 title 和 date 字段 */}
                    </li>
                ))}
            </ul>
        </div>


    );
}

export default App;
